$(document).ready(function(){


	// validate forms
	if($('.js-form-validate').length){
		$('.js-form-validate').parsley({
			successClass: 'is-succes',
			errorClass: 'is-error',
			errorsWrapper: '<ul class="form__error__list"></ul>',
			classHandler: function (el) {
				if (el.$element.is('.form__select'))
					return el.$element.parent();
				else
					return el;
			}
		});

		$.listen('parsley:field:validate', function () {
			validateMsg();
		});

		$('.js-form-submit').on('click', function () {
			$('.js-form-validate').parsley().validate();
			validateMsg();
		});

		var validateMsg = function () {
			if (true === $('.js-form-validate').parsley().isValid()) {
				$('.form .js-error').addClass('is-hidden');
			} else {
				$('.form .js-error').removeClass('is-hidden');
			}
		};
	}

	// custom upload
	$('.js-upload').change(function() {
		var filename = $(this).val();
		var lastIndex = filename.lastIndexOf("\\");
		if (lastIndex >= 0) {
			filename = filename.substring(lastIndex + 1);
		}

		if (filename) {
			$(this).parent().find('.js-upload-filename').val(filename);
		}

	});

	// toggle content on change
	$('.js-toggle-content').on('change', function(e) {

		var dataShowOrHide = $(this).attr('data-showorhide');
		var dataTarget = $(this).attr('data-target');

		if ($(this).is(':checked')) {
			if (dataShowOrHide == 'show') {
				$('#'+dataTarget).removeClass('is-hidden');
				$('#'+dataTarget).find('.js-required').prop('required',true);
			} else {
				$('#'+dataTarget).addClass('is-hidden');
				$('#'+dataTarget).find('.js-required').removeAttr('required');
			}
		}
	}).change();

	// toggle content on change
	$('.js-row-delete').on('click', function(e) {
		e.preventDefault();
		if(confirm("Weet je het zeker?")) {
			$(this).closest('.js-row').slideUp(200);
		}
	});


	// filter
	$('.js-filter').on('change', function(e) {
		var	oldContent = $('.js-filter-content').html();
		$('.js-filter-content').html('');
		$('.js-filter-content').html($(oldContent));
	});

	var $itemsArray = ['abcd','dss9aqnvjpags','gsjkvbwqoq','bbfsdjbgwrobsv'];

	// Autocomplete
	$('.js-autocomplete').autocomplete({
		lookup: $itemsArray,
		onSelect: function (suggestion) {
			$('.js-autocomplete').parent().addClass('is-valid');
		}
	});

});
$(document).ready(function(){

	$('.js-is-hidden').addClass('is-hidden');

	$(window).on("resize", function () {
		$('.js-load_background_image').each(function(i,e){
			var $this = $(this);
			var $theImg = $this.data('backgroundimage');
			$this.css({ 'background-image': 'url('+$theImg.replace(/ /g, '%20')+')' } );
		});
	}).resize();

	// Print
	$('.js-print').click(function() {
		window.print();
	});

	// transfer click to element
	$('body').on('click', '.js-href-click', function(e){
		//$(this).find('.js-href').click(); // Infinite recursion and Not working!!
		if($(e.target).prop('tagName')!='A'){
			var anchor = $(this).find('.js-href').length ? $(this).find('.js-href') : $(this).find('a');
			var theUrl = anchor.attr('href');
			if(theUrl!==undefined && theUrl!=null){
				var blank = anchor.attr('target')=='_blank';
				if(blank || e.ctrlKey || e.metaKey){
					window.open(theUrl);
					if(!e.shiftKey) self.focus(); //doesn't work, but would be nice if it does
				}else window.location=theUrl;
				e.preventDefault();
			}
		}
	});

	// show hide filter
	$('.js-filter').on( 'click', 'button', function(e) {
		e.preventDefault();

		var filterOpen = $(this).hasClass('filter-open'),
			filterClose = $(this).hasClass('filter-close'),
			filterWrapper = $( '.js-filter' );
		//filterContainer = $( '.filter-content' ),
		//filterForm = $( '.js-filter form' );

		if ( filterOpen ) {
			filterWrapper.find('.filter-content').toggleClass( 'is-visible' );
			$('.filter-close').focus();
		} else if ( filterClose ){
			filterWrapper.find('.filter-content').toggleClass( 'is-visible' );
		}
		/*
		 add accessibility fix
		 */
	});

	$(document).on('click', '.js-profile-navtoggle', function(e){
		e.preventDefault();
		$(this).toggleClass('is-active');
		$('.js-profile-nav').toggleClass('is-active');
	});


	// toggle show/hide element
	$('body').on('click', '.js-toggle-element', function(e){
		var theTarget = $(this).attr('data-target');
		$('#'+theTarget).toggleClass('is-hidden');
	});

	// equalize heights
	$('.js-eq-height').matchHeight();

});
$(document).ready(function(){

	$('body').append('<div class="modal js-modal"><div class="modal__main"><a href="#" class="modal__close js-modal-close">Close</a><div class="js-modal-content"></div></div><div class="modal__bg"></div><a</div>');


	function modalClose() {
		$('body').removeClass('modal-is-open');
	}

	$('body').on('click', '.js-modal-close', function(e){
		modalClose();
		return false;
	});

	$('body').on('click', '.js-modal-open', function(e){
		e.preventDefault();
		var $href = $(this).attr('href');

		$.ajax({
			type: "GET",
			url: $href,
			contentType:"application/json; charset=utf-8",
			dataType:"html",
			success: function(response) {

				var $response = $(response);
				$('.js-modal-content').html($response);

				// re-init selects
				$('.modal').find('select').select();

				// re-init form validation
				if($('.js-form-validate-modal').length){
					$('.js-form-validate-modal').parsley({
						successClass: 'is-succes',
						errorClass: 'is-error',
						errorsWrapper: '<ul class="form__error__list"></ul>'
					});

					$.listen('parsley:field:validate', function () {
						validateMsg();
					});

					$('.js-form-submit-modal').on('click', function () {
						$('.js-form-validate-modal').parsley().validate();
						validateMsg();
					});

					var validateMsg = function () {
						if (true === $('.js-form-validate-modal').parsley().isValid()) {
							$('.form .js-error').addClass('is-hidden');
						} else {
							$('.form .js-error').removeClass('is-hidden');
						}
					};
				}

			}
		});

		$('body').addClass('modal-is-open');
	});
});
$(document).ready(function(){

	$('#search_toggle').click(function(e){
		e.preventDefault();
		e.stopPropagation();

		var form = $('#search');
		if(form.is(':visible')) form.addClass('is-hidden');
		else form.removeClass('is-hidden').find('input:first').focus();
	});

	// toggle focus multi level nav
	function tabFocusNav(){
		$('.js-nav-focus').find('> li > a').focus(function(){
			$(this).closest('ul').find('.has-focus').removeClass('has-focus');
			$(this).nextAll('ul:first').addClass('has-focus');
		});
	}
	tabFocusNav();

	// show / hide nav overlay
	if( $(window).width() > 1023 ) {
		var navitem = $('.page__navigation .nav__item'),
			navsearch =  $('#search_toggle'),
			search =  $('#search'),
			overlay = $('.nav-overlay');

		// on hover nav item
		navitem
			.mouseenter(function() {
				if ($(this).find('ul').length) {
					overlay.addClass('is-active');
					search.addClass('is-hidden');
				}
			})
			.mouseleave(function() {
				overlay.removeClass('is-active');
			})
			.mouseup(function(){
				$(this).find('ul').first().removeClass('has-focus');
			});

		navsearch.click(function() {
			//useless though, due to e.stopPropagation()
			overlay.toggleClass('is-active');
		});
	}


	// show / hide mobile nav on hamburger click
	$('.js-toggle-nav').click(function(e) {
		$('body').toggleClass('has-visible-nav');
		e.preventDefault();
	});


	// show / hide subnav items
	$('.js-toggle-subnav').click(function(e) {
		$(this).parent('.nav__item').toggleClass('is-expanded');
		e.preventDefault();
	});


	// show hide / nav on focus skiplink
	if( $(window).width() < 1023 ) {
		$( '.page__navigation' ).on(
			{ focusin: function() {
				$('body').addClass('has-visible-nav');
			}, focusout: function() {
				$('body').removeClass('has-visible-nav');
			}
			});
	}

});
